const imagesDatabase = [
    'https://masterzoo.ua/content/uploads/images/top10-korm-koty-masterzoo-ua.jpg',
    'https://texterra.ru/upload/img/05-10-2021/2/4-1.webp',
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,'
];

let currentIndex = 0;

function createImageElement(imageUrl) {
    const img = document.createElement('img');
    img.src = imageUrl;
    return img;
}

function displayImage(index) {
    const currentImage = document.getElementById('current-image');
    currentImage.src = imagesDatabase[index];
}

function showPrevImage() {
    if (currentIndex === 0) {
        currentIndex = imagesDatabase.length - 1;
    } else {
        currentIndex--;
    }
    displayImage(currentIndex);
}

function showNextImage() {
    if (currentIndex === imagesDatabase.length - 1) {
        currentIndex = 0;
    } else {
        currentIndex++;
    }
    displayImage(currentIndex);
}

window.onload = function() {
    displayImage(currentIndex);

    document.getElementById('prevBtn').addEventListener('click', showPrevImage);
    document.getElementById('nextBtn').addEventListener('click', showNextImage);
};
document.getElementById('login-button').addEventListener('click', function() {
    window.location.href = 'forum.html'; 
});